import {TextField, Button} from '@material-ui/core';

import './styles.scss'

function Input () {
  const [valueMglt, setValueMglt] = useState('')

  return (
    <>
      <form autoComplete="off">
        <TextField  className="textField" label="Distance in MGLT?" value={valueMglt} onChange={setValueMglt(valueMglt)} type="number" variant="filled" />
        <Button  className="button" variant="contained" color="primary">stops</Button>
      </form>
    </>
  );
};

export default Input;
